import { Provider, NETWORKS } from '@web3-ui/core';
import { ConnectWallet, useWallet } from '@web3-ui/core';
import Wrapper from "./Wrapper";

function App() {
  return (
    <Provider network={NETWORKS.mainnet}>
      <div className="flex flex-col items-center justify-center bg-brand-gradient w-full h-screen overflow-hidden p-16">
        <ConnectWallet />
        <Wrapper/>
      </div>
    </Provider>
  );
}

export default App;
